CREATE TABLE activities (
  id integer NOT NULL  primary key,
  name varchar(255) NOT NULL,
  image varchar(255) default NULL,
  model_name varchar(255) NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  is_enabled integer NOT NULL default '0',
  plural_noun varchar(255) NOT NULL);

CREATE TABLE activities_guidebooks (
  activity_id integer NOT NULL,
  guidebook_id integer NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL
);
CREATE TABLE activity_areas (
  id integer NOT NULL  primary key,
  profile_id integer NOT NULL,
  province_state_id integer NOT NULL,
  name varchar(255) NOT NULL,
  start_long varchar(12) default NULL,
  start_lat varchar(12) default NULL,
  is_enabled integer NOT NULL default '1',
  description text,
  parent_id integer default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  rating_count integer default NULL,
  rating_total decimal(10,0) default NULL,
  rating_avg decimal(10,2) default NULL);

CREATE TABLE activity_areas_guidebooks (
  id integer NOT NULL  primary key,
  activity_area_id integer NOT NULL,
  guidebook_id integer NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE acts_as_xapian_jobs (
  id integer NOT NULL  primary key,
  model varchar(255) NOT NULL,
  model_id integer NOT NULL,
  action varchar(255) NOT NULL);

CREATE TABLE blogs (
  id integer NOT NULL  primary key,
  title varchar(255) default NULL,
  body text,
  profile_id integer default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  is_public integer NOT NULL);

CREATE TABLE comments (
  id integer NOT NULL  primary key,
  comment text,
  created_at datetime NOT NULL,
  updated_at datetime NOT NULL,
  profile_id integer default NULL,
  commentable_type varchar(255) NOT NULL default '',
  commentable_id integer NOT NULL,
  is_denied integer NOT NULL default '0',
  is_reviewed integer default '0');

CREATE TABLE contact_messages (
  id integer NOT NULL  primary key,
  profile_id integer default NULL,
  name varchar(255) NOT NULL,
  email varchar(255) NOT NULL,
  message varchar(255) NOT NULL,
  feeling_id integer default NULL,
  guid varchar(255) NOT NULL,
  is_read integer NOT NULL default '0',
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE countries (
  id integer NOT NULL  primary key,
  iso varchar(3) NOT NULL,
  iso3 varchar(3) NOT NULL,
  name varchar(255) NOT NULL,
  display_name varchar(255) NOT NULL,
  num_code integer NOT NULL,
  is_enabled integer NOT NULL default '1',
  start_long varchar(12) default NULL,
  start_lat varchar(12) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE distance_units (
  id integer NOT NULL  primary key,
  name varchar(255) NOT NULL,
  abbreviation varchar(255) NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  magnitude integer NOT NULL default '1',
  singular varchar(255) NOT NULL);

CREATE TABLE feed_items (
  id integer NOT NULL  primary key,
  include_comments integer NOT NULL default '0',
  is_public integer NOT NULL default '0',
  item_id integer default NULL,
  item_type varchar(255) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE feeds (
  id integer NOT NULL  primary key,
  profile_id integer default NULL,
  feed_item_id integer default NULL);

CREATE TABLE feelings (
  id integer NOT NULL  primary key,
  en_name varchar(255) NOT NULL,
  image varchar(255) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE friends (
  id integer NOT NULL  primary key,
  inviter_id integer default NULL,
  invited_id integer default NULL,
  status integer default '0',
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE google_graphable_objects (
  id integer NOT NULL  primary key,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE guidebooks (
  id integer NOT NULL  primary key,
  profile_id integer NOT NULL,
  title varchar(255) NOT NULL,
  publisher_link varchar(255) default NULL,
  edition integer default NULL,
  isbn varchar(16) default NULL,
  author varchar(255) default NULL,
  manufacturer varchar(255) default NULL,
  image varchar(128) default NULL,
  small_img_url varchar(255) default NULL,
  small_img_width integer default NULL,
  small_img_height integer default NULL,
  medium_img_url varchar(255) default NULL,
  medium_img_width integer default NULL,
  medium_img_height integer default NULL,
  large_img_url varchar(255) default NULL,
  large_img_width integer default NULL,
  large_img_height integer default NULL,
  ean varchar(255) default NULL,
  number_of_pages integer default NULL,
  publication_date date default NULL,
  detail_page_url varchar(255) default NULL,
  asin varchar(16) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  rating_count integer default NULL,
  rating_total decimal(10,0) default NULL,
  rating_avg decimal(10,2) default NULL);

CREATE TABLE messages (
  id integer NOT NULL  primary key,
  subject varchar(255) default NULL,
  body text,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  sender_id integer default NULL,
  receiver_id integer default NULL,
  read integer NOT NULL default '0',
  parent_id integer default NULL);

CREATE TABLE notes (
  id integer NOT NULL  primary key,
  profile_id integer NOT NULL,
  title varchar(128) default NULL,
  note text NOT NULL,
  notable_id integer NOT NULL,
  notable_type varchar(255) NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE photos (
  id integer NOT NULL  primary key,
  caption varchar(1000) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  profile_id integer default NULL,
  image varchar(255) default NULL,
  rating_count integer default NULL,
  rating_total decimal(10,0) default NULL,
  rating_avg decimal(10,2) default NULL);

CREATE TABLE possessions (
  id integer NOT NULL  primary key,
  profile_id integer NOT NULL,
  possessable_type varchar(255) NOT NULL,
  possessable_id integer NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE preferences (
  id integer NOT NULL  primary key,
  attribute varchar(255) NOT NULL,
  owner_id integer NOT NULL,
  owner_type varchar(255) NOT NULL,
  preferenced_id integer default NULL,
  preferenced_type varchar(255) default NULL,
  value varchar(255) default NULL,
  profile_id integer NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE profiles (
  id integer NOT NULL  primary key,
  user_id integer default NULL,
  name varchar(255) default NULL,
  website varchar(255) default NULL,
  blog varchar(255) default NULL,
  flickr varchar(255) default NULL,
  about_me text,
  aim_name varchar(255) default NULL,
  gtalk_name varchar(255) default NULL,
  ichat_name varchar(255) default NULL,
  icon varchar(255) default NULL,
  location varchar(255) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  email varchar(255) default NULL,
  is_active integer default '0',
  youtube_username varchar(255) default NULL,
  flickr_username varchar(255) default NULL,
  activity_area_id integer default NULL,
  country_id integer default NULL,
  unique_id varchar(255) NOT NULL,
  blog_title varchar(255) default NULL);

CREATE TABLE province_states (
  id integer NOT NULL  primary key,
  country_id integer NOT NULL,
  name varchar(255) NOT NULL,
  code varchar(3) NOT NULL,
  description varchar(255) default NULL,
  start_long varchar(12) default NULL,
  start_lat varchar(12) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE ratings (
  id integer NOT NULL  primary key,
  rater_id integer default NULL,
  rated_id integer default NULL,
  rated_type varchar(255) default NULL,
  rating decimal(10,0) default NULL);

CREATE TABLE rock_climb_ascent_styles (
  id integer NOT NULL  primary key,
  name varchar(255) NOT NULL,
  description varchar(255) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE rock_climb_crags (
  id integer NOT NULL  primary key,
  profile_id integer NOT NULL,
  activity_area_id integer default NULL,
  name varchar(255) NOT NULL,
  start_long varchar(12) default NULL,
  start_lat varchar(12) default NULL,
  google_map_url varchar(255) default NULL,
  is_enabled integer NOT NULL default '1',
  description varchar(255) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  rating_count integer default NULL,
  rating_total decimal(10,0) default NULL,
  rating_avg decimal(10,2) default NULL);

CREATE TABLE rock_climb_route_comparators (
  id integer NOT NULL  primary key,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE rock_climb_route_grades (
  id integer NOT NULL  primary key,
  america varchar(7) default NULL,
  australia varchar(7) default NULL,
  brazil varchar(7) default NULL,
  england varchar(7) default NULL,
  france varchar(7) default NULL,
  germany varchar(7) default NULL,
  poland varchar(7) default NULL,
  uiaa varchar(7) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE rock_climb_route_types (
  id integer NOT NULL  primary key,
  name varchar(255) NOT NULL,
  description varchar(255) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE rock_climb_routes (
  id integer NOT NULL  primary key,
  profile_id integer NOT NULL,
  activity_id integer NOT NULL default '3',
  rock_climb_crag_id integer NOT NULL,
  name varchar(255) NOT NULL,
  description varchar(255) default NULL,
  rock_climb_route_grade_id integer NOT NULL,
  rock_climb_route_type_id integer NOT NULL,
  start_long varchar(12) default NULL,
  start_lat varchar(12) default NULL,
  is_enabled integer NOT NULL default '1',
  created_at datetime default NULL,
  updated_at datetime default NULL,
  rating_count integer default NULL,
  rating_total decimal(10,0) default NULL,
  rating_avg decimal(10,2) default NULL);

CREATE TABLE rock_climb_routes_rock_climbs (
  rock_climb_route_id integer NOT NULL,
  rock_climb integer NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL
);
CREATE TABLE rock_climbs (
  id integer NOT NULL  primary key,
  profile_id integer NOT NULL,
  rock_climb_route_id integer NOT NULL,
  event_date datetime default NULL,
  rock_climb_ascent_style_id integer default NULL,
  is_public integer NOT NULL default '1',
  is_enabled integer NOT NULL default '1',
  quality integer NOT NULL default '0',
  activity_id integer NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE running_route_types (
  id integer NOT NULL  primary key,
  name varchar(255) NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE running_routes (
  id integer NOT NULL  primary key,
  profile_id integer NOT NULL,
  activity_id integer NOT NULL default '3',
  name varchar(255) NOT NULL,
  location varchar(255) NOT NULL,
  province_state_id integer NOT NULL,
  event_date date default NULL,
  running_route_type_id integer default NULL,
  distance float default NULL,
  distance_unit_id integer default NULL,
  image varchar(255) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  start_long varchar(255) NOT NULL,
  start_lat varchar(255) NOT NULL,
  end_long varchar(255) NOT NULL,
  end_lat varchar(255) NOT NULL,
  rating_count integer default NULL,
  rating_total decimal(10,0) default NULL,
  rating_avg decimal(10,2) default NULL);

CREATE TABLE running_routes_runs (
  running_route_id integer NOT NULL,
  run_id integer NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL
);
CREATE TABLE runs (
  id integer NOT NULL  primary key,
  profile_id integer NOT NULL,
  name varchar(255) default NULL,
  location varchar(255) default NULL,
  province_state_id integer default NULL,
  event_date datetime default NULL,
  start_time varchar(255) default NULL,
  end_time varchar(255) default NULL,
  total_time varchar(255) default NULL,
  distance float default NULL,
  distance_unit_id integer default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  activity_id integer NOT NULL,
  is_public integer NOT NULL default '0',
  start_long varchar(255) NOT NULL,
  start_lat varchar(255) NOT NULL,
  end_long varchar(255) NOT NULL,
  end_lat varchar(255) NOT NULL);

CREATE TABLE schema_migrations (
  version varchar(255) NOT NULL);

CREATE TABLE sessions (
  id integer NOT NULL  primary key,
  session_id varchar(255) default NULL,
  data text,
  updated_at datetime default NULL);

CREATE TABLE ticklists (
  id integer NOT NULL  primary key,
  profile_id integer NOT NULL,
  activity_id integer NOT NULL,
  name varchar(255) NOT NULL,
  description varchar(255) NOT NULL,
  is_public integer NOT NULL default '0',
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE user_icons (
  id integer NOT NULL  primary key,
  profile_id integer NOT NULL,
  icon_name varchar(255) NOT NULL,
  icon_hash varchar(255) NOT NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL);

CREATE TABLE users (
  id integer NOT NULL  primary key,
  login varchar(255) default NULL,
  crypted_password varchar(40) default NULL,
  salt varchar(40) default NULL,
  created_at datetime default NULL,
  updated_at datetime default NULL,
  remember_token varchar(255) default NULL,
  remember_token_expires_at datetime default NULL,
  is_admin integer default NULL,
  can_send_messages integer default '1',
  time_zone varchar(255) default 'UTC',
  email_verification varchar(255) default NULL,
  email_verified integer default NULL,
  identity_url varchar(255) default NULL);

